import express from "express";
import { json } from "body-parser";
import cors from "cors";
import helmet from "helmet";
import morgan from "morgan";

const app = express();
app.use(cors());
app.use(helmet());
app.use(express.json());
app.use(morgan("dev"));

const port = 5000;
const start = async () => {
  app.listen(port, () => {
    console.log(`Web API Listening on port ${port} `);
  });
};
